pragma solidity ^0.4.23;

import "./Transaction.sol";

contract TransactionManager {
    mapping (uint => address[]) transactions;

    function getTransactions(uint id) public view returns (address[]) {
        return transactions[id];
    }

    function addTransaction(uint id,
        uint quantity,
        uint item_price,
        uint order_date,
        string from,
        string to
    ) public returns (address) {
        Transaction transaction = new Transaction(
            id,
            quantity,
            item_price,
            order_date,
            from,
            to
        );

        transactions[id].push(transaction);
        return transaction;
    }

    function addTransactionWithTransport(
        uint id,
        uint quantity,
        uint item_price,
        uint order_date,
        string from,
        string to,
        string transporter,
        uint pickup_date,
        uint deliver_date
    ) public returns (address) {
        Transaction transaction = new Transaction(
            id,
            quantity,
            item_price,
            order_date,
            from,
            to
        );

        transaction.setTransport(
            transporter,
            pickup_date,
            deliver_date
        );

        transactions[id].push(transaction);
        return transaction;
    }

    function whoami() public view returns (address) {
        return msg.sender;
    }
}
